import React from "react";
import {LINKS_NAV} from "../config/config_nav";
import {NavLink} from "react-router-dom";

const Navigation = () => {

    const itemNavigation = LINKS_NAV.map(link => {
        return <div className="nav__item">
            <NavLink  key={link.path} to={link.path}>{link.label}</NavLink>
        </div>

    })
    return <React.Fragment>
        <nav className="nav">
            <div className="nav">
                {itemNavigation}
            </div>
        </nav>
    </React.Fragment>
}
export default Navigation;
